import React from 'react';
import RelatoForm from './components/RelatoForm';
import MapView from './components/MapView';
import RelatoChart from './components/RelatoChart';

function App() {
    return (
        <div>
            <h1>Sistema de Relatos de Focos de Dengue</h1>
            <RelatoForm />
            <MapView />
            <RelatoChart />
        </div>
    );
}

export default App;
